import React, { useState } from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';
import AddFoodPage from './AddFoodPage';
import OrderPage from './OrderPage';

function App() {
  const [foods, setFoods] = useState([]);

  const handleFoodAdded = (foodName, price) => {
    const newFoodItem = { name: foodName, price: price };
    setFoods([...foods, newFoodItem]);
  };

  const handleOrder = (food) => {
    // Here you can implement the logic to handle ordering the food item
    // For demonstration, let's just log the ordered food item to the console
    console.log('Ordered:', food);
  };

  return (
    <Router>
      <div className="app">
        <h1>Food Management System</h1>
        <nav>
          <ul>
            <li>
              <Link to="/">Add Food</Link>
            </li>
            <li>
              <Link to="/order">Order Food</Link>
            </li>
          </ul>
        </nav>
        <Routes>
          <Route path="/" element={<AddFoodPage onFoodAdded={handleFoodAdded} />} />
          <Route path="/order" element={<OrderPage foods={foods} onOrder={handleOrder} />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
